          className: "language-xml",
          children: "<?xml version=\"1.0\"?>\n<sdf version=\"1.6\">\n  <world name=\"robot_playground\">\n\n    <!-- Physics Engine Settings -->\n    <physics name=\"1ms\" type=\"ode\">\n      <max_step_size>0.001</max_step_size>\n      <real_time_factor>1.0</real_time_factor>\n    </physics>\n\n    <!-- Ground Plane -->\n    <include>\n      <uri>model://ground_plane</uri>\n    </include>\n\n    <!-- Sun -->\n    <include>\n      <uri>model://sun</uri>\n    </include>\n\n    <!-- Building 1 -->\n    <model name=\"building1\">\n      <static>true</static>\n      <pose>5 5 0 0 0 0</pose>\n\n      <link name=\"building_link\">\n        <collision name=\"building_collision\">\n          <geometry>\n            <box>\n              <size>4 4 6</size>\n            </box>\n          </geometry>\n        </collision>\n\n        <visual name=\"building_visual\">\n          <geometry>\n            <box>\n              <size>4 4 6</size>\n            </box>\n          </geometry>\n          <material>\n            <ambient>0.7 0.7 0.7 1</ambient>\n            <diffuse>0.7 0.7 0.7 1</diffuse>\n          </material>\n        </visual>\n      </link>\n    </model>\n\n    <!-- Obstacle Course -->\n    <model name=\"obstacles\">\n      <static>true</static>\n\n      <!-- Cylindrical Obstacles -->\n      <link name=\"cylinder1\">\n        <pose>2 -1 0.5 0 0 0</pose>\n        <collision name=\"collision\">\n          <geometry>\n            <cylinder>\n              <radius>0.3</radius>\n              <length>1</length>\n            </cylinder>\n          </geometry>\n        </collision>\n        <visual name=\"visual\">\n          <geometry>\n            <cylinder>\n              <radius>0.3</radius>\n              <length>1</length>\n            </cylinder>\n          </geometry>\n          <material>\n            <ambient>1 0 0 1</ambient>\n          </material>\n        </visual>\n      </link>\n\n      <link name=\"cylinder2\">\n        <pose>3 1 0.5 0 0 0</pose>\n        <collision name=\"collision\">\n          <geometry>\n            <cylinder>\n              <radius>0.3</radius>\n              <length>1</length>\n            </cylinder>\n          </geometry>\n        </collision>\n        <visual name=\"visual\">\n          <geometry>\n            <cylinder>\n              <radius>0.3</radius>\n              <length>1</length>\n            </cylinder>\n          </geometry>\n          <material>\n            <ambient>0 1 0 1</ambient>\n          </material>\n        </visual>\n      </link>\n\n      <!-- Ramp -->\n      <link name=\"ramp\">\n        <pose>0 3 0 0 0.3 0</pose>\n        <collision name=\"collision\">\n          <geometry>\n            <box>\n              <size>4 2 0.2</size>\n            </box>\n          </geometry>\n        </collision>\n        <visual name=\"visual\">\n          <geometry>\n            <box>\n              <size>4 2 0.2</size>\n            </box>\n          </geometry>\n          <material>\n            <ambient>0.5 0.5 0.5 1</ambient>\n          </material>\n        </visual>\n      </link>\n    </model>\n\n    <!-- Spawn Point Marker -->\n    <model name=\"spawn_point\">\n      <static>true</static>\n      <pose>0 0 0.1 0 0 0</pose>\n      <link name=\"spawn_marker\">\n        <visual name=\"marker\">\n          <geometry>\n            <cylinder>\n              <radius>0.2</radius>\n              <length>0.01</length>\n            </cylinder>\n          </geometry>\n          <material>\n            <ambient>0 0 1 0.5</ambient>\n          </material>\n        </visual>\n      </link>\n    </model>\n  </world>\n</sdf>\n"
